import React,{Component} from 'react'




export default class Search extends Component {
    render() {
        return (
            <div>
                <div> 
                    <form method="get">
                        <input type="text"  /> 
                    </form>

                    <div classname="content"></div>
                </div>
            </div>
        );
    }
}
